import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch,Link } from "react-router-dom";
import { MDBRow, MDBCol, MDBInput, MDBBtn} from "mdbreact";
import axios from 'axios';

class Login extends Component {
    constructor(props) {
        super(props);
        this.state = { profil: [] };

    }

    onChange = e => {
        this.setState({ [e.target.id]: e.target.value });
      };

      onSubmit = e => {


      };

    componentDidMount() {

        axios.get('http://localhost:8080/administration')
            .then(response => {
                console.log("login ity o", response.data);

                this.setState({ profil: response.data });
            })
            .catch(function (error) {
                console.log(error);
            })
    }

  render() {
    return (

            <div className="container-fluid">
    <div className="row">
        <div className="col-md-4"></div>
        <div className="col-md-4" id="loginrow">
        <MDBRow>
          <MDBCol md="12">
            <form noValidate onSubmit={this.onSubmit}>
              <p className="h5 text-center mb-4" id="loginp">Connexion de l'administration du site</p>
              <div className="grey-text">
                <MDBInput
                  label="Nom d'utilisateur"
                  icon="envelope"
                  group
                  type="email"
                  success="right"
                  id="email"
                  name="username"
                  onChange={this.onChange}
                  value={this.state.username}

                />

                <MDBInput
                  label="mot de passe"
                  icon="lock"
                  group
                  type="password"
                  onChange={this.onChange}
                  value={this.state.password}
                  id="password"

                />

              </div>
              <div className="text-center">
                <MDBBtn type="submit" id="inscrire-btn">Se Connecter</MDBBtn>
              </div>
            </form><br/>
          </MDBCol>
        </MDBRow>
        </div>
        <div className="col-md-4"></div>
    </div>

        </div>

    );
  }
}
export default Login;
